.btn {
  padding: 0.5rem;
  width: 11.25rem;
  background-color: #fff;
  font-size: 1.05rem;
  border: none;
  border-radius: 0.4rem;
  transition: background-color 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
  cursor: pointer;
  -webkit-box-shadow: 0px 2px 5px 0px rgb(120, 120, 120);
  -moz-box-shadow: 0px 2px 5px 0px rgb(120, 120, 120);
  box-shadow: 0px 2px 5px 0px rgb(120, 120, 120);
}
.btn:hover {
  background-color: #2cf57c;
  -webkit-box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
  -moz-box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
  box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
}

.cta {
  background-color: #2ade72;
  -webkit-box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
  -moz-box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
  box-shadow: 0px 2px 5px 0px rgb(42, 222, 114);
}
